pragma solidity ^0.8.0;
contract CryptoSubs {
    address payable owner;

    struct Subscription {
        uint256 depositAmount;
        uint256 time;
        address addressToWithdraw;
        uint256 howManySubscriptions;
        uint256 subscriptionCount;
        bool isCancelled;
    }

    mapping(address => Subscription) public subscriptions;
    address[] public subscriptionKeys;

    constructor() {
        owner = payable(msg.sender);
    }

    function deposit(
        uint256 _time,
        address _addressToWithdraw,
        uint256 _howManySubscriptions
    ) public payable {
        require(msg.value > 0, "Deposit amount should be greater than 0");
        require(
            subscriptions[msg.sender].depositAmount == 0,
            "Subscription already exists"
        );

        subscriptions[msg.sender] = Subscription({
            depositAmount: msg.value,
            time: _time,
            addressToWithdraw: _addressToWithdraw,
            howManySubscriptions: _howManySubscriptions,
            subscriptionCount: 0,
            isCancelled: false
        });
        subscriptionKeys.push(msg.sender);
    }

    function cancelSubscription() public {
        require(
            subscriptions[msg.sender].depositAmount > 0,
            "Subscription doesn't exist"
        );
        require(
            subscriptions[msg.sender].isCancelled == false,
            "Subscription already cancelled"
        );

        subscriptions[msg.sender].isCancelled = true;
    }

    function withdraw() public {
        require(msg.sender == owner, "Only owner can withdraw funds");

        uint256 balance = address(this).balance;

        require(balance > 0, "No funds available for withdrawal");

        owner.transfer(balance);
    }

    function makeScheduledPayments() public {
        for (uint256 i = 0; i < subscriptionKeys.length; i++) {
            Subscription storage subscription = subscriptions[subscriptionKeys[i]];

            if (
                subscription.depositAmount > 0 &&
                subscription.isCancelled == false &&
                block.timestamp >=
                subscription.subscriptionCount * subscription.time
            ) {
                subscription.subscriptionCount++;

                if (subscription.subscriptionCount >
                    subscription.howManySubscriptions
                ) {
                    subscription.isCancelled = true;
                } else {
                    payable(subscription.addressToWithdraw).transfer(
                        subscription.depositAmount
                    );
                }
            }
        }
    }

    function getSubscriptionsData(address _addressToWithdraw)
        public
        view
        returns (
            uint256[] memory paidSubscriptions,
            uint256[] memory unpaidSubscriptions,
            uint256[] memory cancelledSubscriptions
        )
    {
        uint256 paidCount = 0;
        uint256 unpaidCount = 0;
        uint256 cancelledCount = 0;

        for (uint256 i = 0; i < subscriptionKeys.length; i++) {
            Subscription storage subscription = subscriptions[subscriptionKeys[i]];

            if (subscription.addressToWithdraw == _addressToWithdraw) {
                if (subscription.isCancelled) {
                    cancelledCount++;
                } else if (
                    subscription.subscriptionCount >=
                    subscription.howManySubscriptions
                ) {
                    paidCount++;
                } else {
                    unpaidCount++;
                }
            }
        }

        paidSubscriptions = new uint256[](paidCount);
        unpaidSubscriptions = new uint256[](unpaidCount);
        cancelledSubscriptions = new uint256[](cancelledCount);

        paidCount = 0;
        unpaidCount = 0;
        cancelledCount = 0;

        for (uint256 i = 0; i < subscriptionKeys.length; i++) {
            Subscription storage subscription = subscriptions[subscriptionKeys[i]];

            if (subscription.addressToWithdraw == _addressToWithdraw) {
                if (subscription.isCancelled) {
                    cancelledSubscriptions[cancelledCount] = i;
                    cancelledCount++;
                } else if (
                    subscription.subscriptionCount >=
                    subscription.howManySubscriptions
                ) {
                    paidSubscriptions[paidCount] = i;
                    paidCount++;
                } else {
                    unpaidSubscriptions[unpaidCount] = i;
                    unpaidCount++;
                }
            }
        }
    }
}

